import "../Css/Prof.css";
import React from "react";
import { Link } from "react-router-dom";

import image1 from '../Home.png';
import image2 from '../Search.png';
import image3 from '../chat.png';
import image4 from '../profile.png';

//import image from './IMG_6793.jpeg';




function Users() {
  return <h2>Users</h2>;
}



//==================  PROFIL SIDA ====================

const click = event => {
   
  console.log();
};

const MyProfile = () =>{

  return (

    <><div className="Containers">
      <header className="Headers">
        <h1> My Profile </h1>
      </header>

      <div className="ProfilePicture">


      </div>
      <div className="Informations">



        <h2> Moa Burevik</h2>



        <button onClick={click} className="buttonList">
          <Link to="/mylist">My List</Link>
        </button>

      </div>


    </div><div className="Bar">
        <nav>
          <Link to="/"><img className="homepic1" src={image3} alt="home" /></Link>
          <Link to="/Search"><img className="homepic2" src={image2} alt="search" /></Link>
          <Link to="/Recomend"> <img className="homepic3" src={image1} alt="chat" /></Link>
          <Link to="/MyProfile"><img className="homepic4" src={image4} alt="profile" /></Link>
        </nav>
      </div></>
  );



}
function MyList(){
 
    return (
      <div className="Mylist">
          <div className="Back">
          <Link to="/MyProfile"> Back </Link>
          </div>
              <header className="App-headers">
              <h1>MY LIST</h1>
              </header>
       
        <div className="List-container">
           <p> My List</p>
            <ul>
            </ul>
        </div>
       
      </div>
     
      /*loop fÃķr att addera div vid klick*/
      /*movie name*/
    );
}
export{MyProfile, MyList } ;
